import { useState, useEffect } from "react";
import { Doughnut } from "react-chartjs-2";
import axios from "axios";

const values = {
  id: "",
  userName: "",
  projectName: "",
  startedTime: "",
};
function ProgressList() {
  const [form, setForm] = useState(values);

  useEffect(() => {
    axios
      .get("http://localhost:8080/progress/get")
      .then((res) => setForm(res.data));
  }, []);

  const data = {
    labels: [form.toString()],
    datasets: [
      {
        label: "# of Votes",
        data: [12, 19, 3, 5, 2, 3],
        backgroundColor: [
          "rgba(255, 99, 132, 0.2)",
          "rgba(54, 162, 235, 0.2)",
          "rgba(255, 206, 86, 0.2)",
          "rgba(75, 192, 192, 0.2)",
          "rgba(153, 102, 255, 0.2)",
          "rgba(255, 159, 64, 0.2)",
        ],
        borderColor: [
          "rgba(255, 99, 132, 1)",
          "rgba(54, 162, 235, 1)",
          "rgba(255, 206, 86, 1)",
          "rgba(75, 192, 192, 1)",
          "rgba(153, 102, 255, 1)",
          "rgba(255, 159, 64, 1)",
        ],
        borderWidth: 1,
      },
    ],
  };

  const DoughnutChart = () => (
    <>
      <div className="header">
        <h1 className="title">Doughnut Chart</h1>
        <div className="links">
          <a
            className="btn btn-gh"
            href="https://github.com/reactchartjs/react-chartjs-2/blob/master/example/src/charts/Doughnut.js"
          >
            Github Source
          </a>
        </div>
      </div>
    </>
  );
  return (
    <div>
      <Doughnut data={data} />
    </div>
  );
}

export default ProgressList;
